/*Table structure for table `tb_bulletin` */

DROP TABLE IF EXISTS `tb_bulletin`;

CREATE TABLE `tb_bulletin` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `city_id` int(10) NOT NULL DEFAULT '0' COMMENT '大市ID',
  `county_id` int(10) NOT NULL DEFAULT '0' COMMENT '区县ID',
  `eduinst_id` int(10) NOT NULL DEFAULT '0' COMMENT '教育局ID',
  `school_id` int(10) NOT NULL DEFAULT '0' COMMENT '学校ID',
  `type` enum('NOTICE','PUBLIC') DEFAULT 'PUBLIC' COMMENT '类型(NOTICE:通知,PUBLIC:公告)',
  `title` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '标题',
  `content` text CHARACTER SET utf8 COMMENT '内容',
  `create_time` datetime DEFAULT NULL COMMENT '添加日期',
  `create_id` int(10) DEFAULT NULL COMMENT '添加人',
  `publish_time` datetime DEFAULT NULL COMMENT '发布日期',
  `publish_id` int(10) DEFAULT NULL COMMENT '发布人',
  `attachment` text COMMENT '附件',
  `read_num` int(10) NOT NULL DEFAULT '0' COMMENT '读取次数',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '状态(0:未发布,1:已发布)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC COMMENT='通知公告';

