/*Table structure for table `tb_eduinst_auditing` */

DROP TABLE IF EXISTS `tb_eduinst_auditing`;

CREATE TABLE `tb_eduinst_auditing` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(10) NOT NULL COMMENT '用户ID',
  `report_id` int(10) NOT NULL COMMENT '填报年份',
  `eduinst_id` int(10) NOT NULL COMMENT '教育局ID',
  `audit_time` datetime DEFAULT NULL COMMENT '审核日期',
  `audit_note` varchar(512) DEFAULT NULL COMMENT '审核意见',
  `collections_id` varchar(1024) DEFAULT NULL COMMENT '采集项ID',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '审核状态(0:未审核,1:审核通过,2:审核未通过)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='审核记录';

/*Data for the table `tb_eduinst_auditing` */

/*Table structure for table `tb_eduinst_collection` */

DROP TABLE IF EXISTS `tb_eduinst_collection`;

CREATE TABLE `tb_eduinst_collection` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `inst_id` int(10) NOT NULL COMMENT '教育局ID',
  `quota_id` int(10) NOT NULL COMMENT '指标ID',
  `collection_id` int(10) NOT NULL COMMENT '采集项ID',
  `report_id` int(10) NOT NULL COMMENT '填报年份ID',
  `content` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '填报内容',
  `create_time` datetime DEFAULT NULL COMMENT '保存日期',
  `create_id` int(10) DEFAULT NULL COMMENT '添加人',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC COMMENT='教育局采集内容表';

/*Data for the table `tb_eduinst_collection` */

/*Table structure for table `tb_eduinst_collection_map` */

DROP TABLE IF EXISTS `tb_eduinst_collection_map`;

CREATE TABLE `tb_eduinst_collection_map` (
  `inst_id` int(10) NOT NULL COMMENT '教育局ID',
  `collection_id` int(10) NOT NULL COMMENT '采集项ID',
  `report_id` int(10) NOT NULL COMMENT '填报年份ID',
  `create_time` datetime DEFAULT NULL COMMENT '添加日期',
  `create_id` int(10) DEFAULT NULL COMMENT '添加人',
  PRIMARY KEY (`inst_id`,`collection_id`,`report_id`) USING BTREE
