/*Table structure for table `tb_school` */

DROP TABLE IF EXISTS `tb_school`;

CREATE TABLE `tb_school` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `CODE` varchar(255) NOT NULL COMMENT '标识码',
  `NAME` varchar(255) NOT NULL COMMENT '学校名称',
  `city` varchar(255) NOT NULL COMMENT '所属市',
  `county` varchar(255) NOT NULL COMMENT '所属区县',
  `region_type` varchar(255) DEFAULT NULL COMMENT '城乡分类',
  `run_by` varchar(255) DEFAULT NULL COMMENT '办学者类型',
  `type` int(20) NOT NULL COMMENT '办学类型',
  `eduinst_id` int(10) DEFAULT NULL COMMENT '所属教育局',
  `master_name` varchar(255) DEFAULT NULL COMMENT '校长姓名',
  `master_phone` varchar(255) DEFAULT NULL COMMENT '校长手机号',
  `vice_name` varchar(255) DEFAULT NULL COMMENT '副校长姓名',
  `vice_phone` varchar(255) DEFAULT NULL COMMENT '副校长手机号',
  `report_name` varchar(255) DEFAULT NULL COMMENT '填报人姓名',
  `report_phone` varchar(255) DEFAULT NULL COMMENT '填报人手机号',
  `create_time` datetime DEFAULT NULL COMMENT '添加日期',
  `create_id` int(10) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '更新日期',
  `update_id` int(10) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `CODE` (`CODE`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=71284 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='学校表';

