/*Table structure for table `tb_school_auditing` */

DROP TABLE IF EXISTS `tb_school_auditing`;

CREATE TABLE `tb_school_auditing` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(10) NOT NULL COMMENT '用户ID',
  `report_id` int(10) NOT NULL COMMENT '填报年份',
  `school_id` int(10) NOT NULL COMMENT '学校ID',
  `audit_time` datetime DEFAULT NULL COMMENT '审核日期',
  `audit_note` varchar(512) DEFAULT NULL COMMENT '审核意见',
  `collections_id` varchar(1024) DEFAULT NULL COMMENT '采集项ID',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '审核状态(0:未审核,1:审核通过,2:审核未通过)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='审核记录';

/*Data for the table `tb_school_auditing` */

/*Table structure for table `tb_school_class` */

DROP TABLE IF EXISTS `tb_school_class`;

CREATE TABLE `tb_school_class` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(10) NOT NULL COMMENT '年级',
  `classes` int(10) NOT NULL COMMENT '班级号',
  `nums` int(10) NOT NULL COMMENT '人数',
  `school_id` int(10) NOT NULL COMMENT '班级id',
  `year` int(255) NOT NULL COMMENT '年份',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

