/*Table structure for table `tb_school_process` */

DROP TABLE IF EXISTS `tb_school_process`;

CREATE TABLE `tb_school_process` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `school_id` int(10) NOT NULL COMMENT '填报学校id',
  `report_id` int(10) NOT NULL COMMENT '填报年份id',
  `total_num` int(10) NOT NULL DEFAULT '0' COMMENT '所有数量',
  `finish_num` int(10) NOT NULL DEFAULT '0' COMMENT '已完成数量',
  `submit_id` int(10) DEFAULT NULL COMMENT '提交人',
  `submit_time` datetime DEFAULT NULL COMMENT '提交审核日期',
  `audit_time` datetime DEFAULT NULL COMMENT '审核日期',
  `audit_id` int(10) DEFAULT NULL COMMENT '审核人ID',
  `audit_note` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '审核意见',
  `status` int(10) NOT NULL DEFAULT '0' COMMENT '状态(0:填报中,1:未审核,2:审核中,3:审核完成,4:返回修改,5:提交到市级)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1049 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC COMMENT='学校填报审核进度';

